import React from "react";
import { Link, Outlet } from "react-router-dom";
import "./Layout.css";
import logo from "../images/logo.png"; // update the path to match your structure

const Layout = () => {
  return (
    <div className="layout">
      {/* Navigation Bar */}
      <nav className="nav-bar">
        <div className="logo-container">
          <img src={logo} alt="JS Visualizer Logo" className="logo" />
        </div>
        <div className="nav-links">
          <Link to="/">JS Editor</Link> | <Link to="/docs">Documentation</Link> | <Link to="/about">About</Link>
        </div>
      </nav>

      {/* Main content routed via Outlet */}
      <div className="main-content">
        <Outlet />
      </div>
    </div>
  );
};

export default Layout;
